import useBaseUrl from '@docusaurus/useBaseUrl';
export const toc = [{
  value: 'Viewing Performance Results in the Sauce Labs App',
  id: 'viewing-performance-results-in-the-sauce-labs-app',
  children: []
}, {
  value: 'Resetting Baselines for a Failed Test',
  id: 'resetting-baselines-for-a-failed-test',
