const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Every time you run a performance test, whether it is through the Speedo command line or an automation script testing page load or motion effects, the results of the test are compiled and displayed in your Sauce Labs app, and available to all members of your team for analysis and debugging.`}</p>
    <h2 {...{
      "id": "viewing-performance-results-in-the-sauce-labs-app"
    }}>{`Viewing Performance Results in the Sauce Labs App`}</h2>
    <p>{`From your Sauce Labs `}<strong parentName="p">{`Test Results`}</strong>{` page, chose one of your completed Performance tests for an overview of its results.`}</p>
    <img src={useBaseUrl('img/performance/perf-home.png')} alt="Performance Overview" width="750" />
    <p>{`From here, you can drill into a variety of specific details about the test:`}</p>
    <ul>
      <li parentName="ul">{`Play the video of the test execution.`}</li>
      <li parentName="ul">{`Click the tabs in the panel on the right to see data about the test:`}
        <ul parentName="li">
          <li parentName="ul">{`The `}<strong parentName="li">{`Commands`}</strong>{` tab shows you the script associated with each transition of the test.`}</li>
          <li parentName="ul">{`The `}<strong parentName="li">{`View Logs`}</strong>{` tab allows you to choose from a menu of log data captured for the test, including the default `}<inlineCode parentName="li">{`performance.json`}</inlineCode>{`, which shows you the results.`}</li>
          <li parentName="ul">{`The `}<strong parentName="li">{`Metadata`}</strong>{` tab shows you the basic identity of the test, such as the Job ID, Name, and Build, which you may need to use if you are using this data in API calls or other testing.`}</li>
        </ul>
      </li>
      <li parentName="ul">{`At the bottom  of the interface, click the `}<strong parentName="li">{`Performance`}</strong>{` tab for a score overview and access to the `}<strong parentName="li">{`Performance Report`}</strong>{`.`}</li>
    </ul>
    <h2 {...{
      "id": "resetting-baselines-for-a-failed-test"
    }}>{`Resetting Baselines for a Failed Test`}</h2>
    <p>{`When you expand the Performance tab, if any of the metrics in your test fall  outside the  established baseline, this is where you have the option to reset the baseline if you wish.`}</p>
    <img src={useBaseUrl('img/performance/perf-reset-base.png')} alt="Reset  Baseline" width="750" />
    <h2 {...{
      "id": "opening-the-performance-report"
    }}>{`Opening the Performance Report`}</h2>
    <p>{`The full Performance Report gives you more detail about the results of your test and its statistics tracked over time.`}</p>
    <img src={useBaseUrl('img/performance/perf-detail.png')} alt="Performance Full Report" width="750" />
    <p>{`In this view, you can see the overall score for the test, plus individual scores for each metric measured in the test. You  can click on any of the individual metrics to see a popup graphical representation of that metric's historical performance. You can then click the `}<strong parentName="p">{`View History`}</strong>{`  link within the popup window to bring up an interactive view of that graph in which you can hover over the graph to see values for that metric each time the test has been run. Use the drop down menu at the top left of the window to see the history graph for a different metric, or click the `}<inlineCode parentName="p">{`+`}</inlineCode>{` icon to show the graphs for two metrics concurrently, as illustrated in the following image.`}</p>
    <img src={useBaseUrl('img/performance/perf-history.png')} alt="Performance History Comparison" width="750" />
    <h3 {...{
      "id": "performance-score"
    }}>{`Performance Score`}</h3>
    <p>{`A performance score is a rating between 0 and 100 indicating how well your page is performing compared to the industry standard. 0 is the lowest possible score and indicates a serious performance issue, while 100 indicates a top-performing application.`}</p>
    <p>{`The metric is similar to the performance score you can find in a `}<a parentName="p" {...{
        "href": "https://developers.google.com/web/tools/lighthouse"
      }}>{`Google Lighthouse Report`}</a>{`. The scoring distribution is a log-normal distribution derived from the performance metrics of real website performance data on HTTPArchive.`}</p>
    <p>{`The color-coding maps to these Performance score ranges:`}</p>
    <ul>
      <li parentName="ul">{`0 to 49 (slow): Red`}</li>
      <li parentName="ul">{`50 to 89 (average): Orange`}</li>
      <li parentName="ul">{`90 to 100 (fast): Green`}</li>
    </ul>
    <p>{`Ref: `}<a parentName="p" {...{
        "href": "https://web.dev/performance-scoring/#lighthouse-6"
      }}>{`https://web.dev/performance-scoring/#lighthouse-6`}</a></p>
    <p>{`The score is a weighted average between:`}</p>
    <ul>
      <li parentName="ul">{`First Contentful Paint`}</li>
      <li parentName="ul">{`Speed Index`}</li>
      <li parentName="ul">{`Largest Contentful Paint`}</li>
      <li parentName="ul">{`Time to Interactive`}</li>
      <li parentName="ul">{`Total Blocking Time`}</li>
      <li parentName="ul">{`Cumulative Layout Shift`}</li>
    </ul>
    <p>{`See `}<a parentName="p" {...{
        "href": "/performance/one-page#metric-values"
      }}>{`Metric Values`}</a>{` for definitions of each metric.`}</p>
    <h2 {...{
      "id": "viewing-the-trace-report"
    }}>{`Viewing the Trace Report`}</h2>
    <p>{`Another useful tool that is accessible from the Performance Report is the Trace Report. Click the `}<strong parentName="p">{`View Trace`}</strong>{` button in the top right of the Performance Report screen to open the Chrome DevTools webpage showing the Javascript method signatures in a hierarchical view for each thread in each process.`}</p>
    <img src={useBaseUrl('img/performance/perf-trace.png')} alt="Performance Trace Report" width="750" />
    <p>{`The Trace Report contains information on everything that happened during the capturing process so you can get a better idea of how the Chrome browser is interacting with your website. You can inspect when JavaScript functions are being executed or when network requests are being made. The view is completely interactive so you can tailor the data displayed in a variety of ways to help you determine, for example, which JavaScript function has been blocking the main thread of the browser, causing a slow page load.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
